const d = document;

d.addEventListener("DOMContentLoaded", () => {
  Parse();
});

const Parse = (destinos) => {
  let pd = destinos[0]["nombre"];
  console.log("js vanilla viajes", pd);
  return `Estos son los viajes: pd`
};

export default Parse;
